import React, { useState, useEffect } from "react";
import { fetchDailyData } from "../../api/index";

const Chart = () => {
  const [dailyData, setDailyData] = useState({});

  useEffect(() => {
    const fetchAPI = async () => {
      setDailyData(await fetchDailyData());
    };
  });

  return (
    <div>
      <h1>Chart</h1>
    </div>
  );
};

export default Chart;
